import logo from './logo.svg';
import './App.css';
// import imgs from './images/port11.png'

function Header() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container">
        <a className="navbar-brand" href="#">Portfolio.</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>

        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item">
              <a className="nav-link" href="#">Home</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">About</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">Skills</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">Projects</a>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

function Introdiv()
{
  return (

    <div className="matter col-lg-6 col-md-12 col-sm-12">
    <h3>Hello, It's Me</h3>
    <h1>Mohan satya prasad</h1>
    <h3>And I'm a <span>Frontend Devoloper</span></h3>
    <p>Actually now i am practicing React js that'swhy i made this.</p>

    <div className="socialmedia">
        <a href="#" ><i class="fa-brands fa-facebook"></i></a>
        <a href="#" ><i class="fa-brands fa-instagram"></i></a>
        <a href="#" ><i class="fa-brands fa-linkedin"></i></a>
        <a href="#" ><i class="fa-brands fa-twitter"></i></a>
    </div>

    <a href="#" className="btn">View my Resume</a>
</div>
  )
}

function Imagediv()
{
  return (
    <div className="homeimg col-lg-6 col-md-12 col-sm-12">
    <div className="photodiv">
    </div>
    <img src="mypic.png" alt="msp"  className="myimg" />
 </div>
  )
}

function Body()
{
  return (
    <section className="home">
       <div className="container">
       <div className="row">
        <Introdiv/>
        <Imagediv/>
        </div>
        </div>
    </section>
  )
}

function App() {
  return (
    <div className='App'>
      <Header/>
      <Body/>
    </div>
  );
}

export default App;
